import React from 'react';
import './Card.css';

function Card({id,name}) {
    return (
        <div className="item" key={id}>
            {name}
            <br/>
            <img alt="" width="100%" height="100%" src={"https://source.unsplash.com/random/200x200"} />
        </div>
    )
}

export default Card;
